import React, { useState } from "react";

const handleDrop = (
  event,
  setParsedData,
  setIsJsonUploaded,
  setErrorMessage,
  setJobNumber
) => {
  event.preventDefault();
  const file = event.dataTransfer.files[0];
  if (file && file.type === "application/json") {
    const jobNumber = file.name.split(".")[0]; // Extract job number from file name
    setJobNumber(jobNumber);

    const reader = new FileReader();
    reader.onload = (e) => {
      try {
        const jsonString = e.target.result;
        const json = JSON.parse(jsonString);

        const nodes = json.nodes;
        const data = [];
        const errors = [];

        Object.keys(nodes).forEach((nodeId) => {
          const node = nodes[nodeId];
          const attributes = node.attributes;

          try {
            // Stringify the attributes object to allow manual extraction
            const attributesString = JSON.stringify(attributes);

            // Extract the desired attributes manually
            const nodeType =
              attributesString.match(
                /"node_type":\{"-Imported":"(.*?)"/
              )?.[1] || "N/A";
              console.log(attributesString)
            const poleCount =
              attributesString.match(
                /"pole_count":\{"-Imported":"(.*?)"/
              )?.[1] || "N/A";
            const poleTag =
              attributesString.match(
                /"pole_tag":\{"-Imported":\{"tagtext":"(.*?)"/
              )?.[1] || "N/A";
            const constructionNotes =
              attributesString.match(/"construction_notes":\{(.*?)\}/)?.[1] ||
              "N/A";

            // If constructionNotes is not empty, process further
            const filteredNotes =
              constructionNotes !== "N/A"
                ? Object.entries(JSON.parse(`{${constructionNotes}}`))
                    .filter(([_, note]) => note.attacher === "Alabama Power")
                    .map(([_, note]) => note.note)
                    .join(", ")
                : "N/A";

            // Push the parsed data
            data.push({
              node: nodeId,
              nodeType,
              poleCount,
              poleTag,
              constructionNotes: filteredNotes,
            });
          } catch (error) {
            errors.push(`Issue with attributes for node ID: ${nodeId}`);
            console.error(`Error processing node ID ${nodeId}:`, error);
          }
        });

        // Sort data by node type
        data.sort((a, b) => a.nodeType.localeCompare(b.nodeType));

        setParsedData(data);
        setErrorMessage(errors.join(" | "));
        setIsJsonUploaded(true);
      } catch (error) {
        console.error("Error parsing JSON", error);
        setErrorMessage("Error parsing JSON file.");
      }
    };
    reader.readAsText(file);
  }
};

function App() {
  const [parsedData, setParsedData] = useState([]);
  const [isJsonUploaded, setIsJsonUploaded] = useState(false);
  const [errorMessage, setErrorMessage] = useState("");
  const [jobNumber, setJobNumber] = useState("");

  return (
    <div className="min-h-screen flex flex-col">
      {/* Header */}
      <header className="bg-blue-600 text-white py-4 px-8 shadow-md">
        <h1 className="text-xl font-semibold">MMU JSON Parser</h1>
        {jobNumber && <h2 className="text-lg mt-2">Job Number: {jobNumber}</h2>}
      </header>

      <main className="flex-grow p-8 bg-gray-100">
        {errorMessage && (
          <div className="mb-4 p-4 bg-red-100 text-red-700 border border-red-400 rounded">
            {errorMessage}
          </div>
        )}

        {isJsonUploaded ? (
          <div className="text-gray-800">
            <h3 className="text-lg font-semibold mb-4">Sorted Node Data:</h3>
            <div className="bg-white border border-gray-300 rounded p-4">
              <div className="grid gap-4">
                {parsedData.map((item, index) => (
                  <div key={index} className="p-2 border-b border-gray-200">
                    <p>
                      <strong>Node ID:</strong> {item.node}
                    </p>
                    <p>
                      <strong>Type:</strong> {item.nodeType}
                    </p>
                    <p>
                      <strong>Pole Count:</strong> {item.poleCount}
                    </p>
                    <p>
                      <strong>Pole Tag:</strong> {item.poleTag}
                    </p>
                    {item.constructionNotes && (
                      <p>
                        <strong>Construction Notes:</strong>{" "}
                        {item.constructionNotes}
                      </p>
                    )}
                  </div>
                ))}
              </div>
            </div>
          </div>
        ) : (
          <div
            onDragOver={(e) => e.preventDefault()}
            onDrop={(e) =>
              handleDrop(
                e,
                setParsedData,
                setIsJsonUploaded,
                setErrorMessage,
                setJobNumber
              )
            }
            className="w-full h-48 border-4 border-dashed border-gray-300 flex items-center justify-center bg-white text-center cursor-pointer hover:border-gray-500 transition duration-300"
          >
            Drop your JSON file here
          </div>
        )}
      </main>
    </div>
  );
}

export default App;
